{
  "version": "0.2",
  "phases": {
    "install": {
      "commands": [
        "npm install aws-cdk@2.0.0",
        "ls -ltr",
        "pwd",
        "python -m pip install -r requirements.txt"
      ]
    },
    "build": {
      "commands": [
        "cd $CODEBUILD_SRC_DIR/",
        "pwd",
        "ls -ltr",
        "npx cdk --version",
        "npx cdk ls",
        "npx cdk deploy CdkDemoLambdaStack-prod --require-approval never"
      ]
    }
  },
  "artifacts": {
    "base-directory": "$CODEBUILD_SRC_DIR/",
    "files": [
      "**/*",
      "CdkDemoLambdaStack-prod.template.json"
    ]
  }
}
